INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (1, 3001, "2024/10/31 12:00:00", 2.1, 0.0, "2030/01/01 14:59:59", 130011, -416.5, 3001100, "ヤマト", 100, 2, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (4, 3001, "2024/10/31 12:00:00", 5.68, 0.0, "2030/01/01 14:59:59", 130011, -416.5, 3001101, "ヤマト", 101, 2, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (1, 3001, "2024/10/31 12:00:00", 0.0, 0.0, "2030/01/01 14:59:59", 130011, -416.5, 3001102, "ヤマト", 102, 1, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (1, 3002, "2024/10/31 12:00:00", 0.0, 0.0, "2030/01/01 14:59:59", 130211, -416.5, 3002100, "フブキ", 100, 1, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (1, 3002, "2024/10/31 12:00:00", 0.0, 0.0, "2030/01/01 14:59:59", 130211, -416.5, 3002101, "フブキ", 101, 1, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (5, 3002, "2024/10/31 12:00:00", 8.53, 0.0, "2030/01/01 14:59:59", 130211, -416.5, 3002102, "フブキ", 102, 2, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (7, 3002, "2024/10/31 12:00:00", 5.67, 0.0, "2030/01/01 14:59:59", 130211, -416.5, 3002103, "フブキ", 103, 1, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (1, 3002, "2024/10/31 12:00:00", 0.0, 0.0, "2030/01/01 14:59:59", 130211, -416.5, 3002104, "フブキ", 104, 1, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3, 3004, "2024/10/31 12:00:00", 0.0, 0.0, "2030/01/01 14:59:59", 130211, -416.5, 3002300, "フブキ", 300, 3, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (7, 3005, "2024/10/31 12:00:00", 0.0, 0.0, "2030/01/01 14:59:59", 130211, -416.5, 3002400, "フブキ", 301, 7, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (2, 3003, "2024/10/31 12:00:00", 4.4, 0.0, "2030/01/01 14:59:59", 130211, -416.5, 3003200, "フブキ", 200, 1, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (7, 3003, "2024/10/31 12:00:00", 0.0, 0.0, "2030/01/01 14:59:59", 130211, -416.5, 3003201, "フブキ", 201, 7, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (1, 3003, "2024/10/31 12:00:00", 5.6, 0.0, "2030/01/01 14:59:59", 130211, -416.5, 3003202, "フブキ", 202, 2, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪");
